"use strict";(self.webpackChunkwljs_docs=self.webpackChunkwljs_docs||[]).push([[9578],{3859:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"practice-integration","metadata":{"permalink":"/wljs-docs/blog/practice-integration","source":"@site/blog/2023-07-22-pratical-integration/index.md","title":"WLJS in practice. Integrating absorption spectra","description":"I would like to start this series of application cases, where I am going to solve real-life problems I face using WLJS Frontend. Since my main area is quantum physics, it will be more focused on the scientific research field.","date":"2023-07-22T00:00:00.000Z","formattedDate":"July 22, 2023","tags":[{"label":"frontend","permalink":"/wljs-docs/blog/tags/frontend"},{"label":"practice","permalink":"/wljs-docs/blog/tags/practice"},{"label":"dynamics","permalink":"/wljs-docs/blog/tags/dynamics"}],"readingTime":0.775,"hasTruncateMarker":true,"authors":[{"name":"Kirill Vasin","title":"Maintainer","url":"https://github.com/JerryI","imageURL":"https://avatars.githubusercontent.com/u/4111822?s=48&v=4","key":"jerryi"}],"frontMatter":{"slug":"practice-integration","title":"WLJS in practice. Integrating absorption spectra","authors":"jerryi","tags":["frontend","practice","dynamics"],"enableComments":true},"nextItem":{"title":"Developing library function in a notebook","permalink":"/wljs-docs/blog/practical-working-withlibs"}},"content":"![](ezgif.com-video-to-gif-26.gif)\\n\\nimport Component from \'@site/src/components/wljs-notebook-react/includes\';\\nimport Notebook from \'@site/src/components/wljs-notebook-react\';\\n\\n<Component></Component>\\n\\nI would like to start this series of application cases, where I am going to solve real-life problems I face using WLJS Frontend. Since my main area is quantum physics, it will be more focused on the scientific research field.\\n\\nYou may think about notebooks as a sort of small apps. Useful, minimalistic and reactive with respect to the input data. I have been using Origin Pro for processing data for quite a long, however among of all scientific tools, most of them suffer from poor GUI. Looking at GUI of modern VST EQ plugins makes me envy, since there is nothing more clear and than dragging a pointer and seeing the result in the real-time.\\n\\nToday I will try to bring those ideas to live in a one short example\\n\\n\x3c!--truncate--\x3e\\n\\n<Notebook code=\\"\\" name=\\"tabernacle-040ef\\">tabernacle-040ef</Notebook>\\n\\n\\nThe original data is accessible by the link\\n- [Archive.zip](Archive.zip)"},{"id":"practical-working-withlibs","metadata":{"permalink":"/wljs-docs/blog/practical-working-withlibs","source":"@site/blog/2023-07-21-polygon/index.md","title":"Developing library function in a notebook","description":"In general, libraries shipped with WLJS Frontend are not reproducing even 20% of Mathematica\'s dynamic or graphics functions. Therefore, it is not a big deal to come back quite frequently to the source code of wljs-graphics-d3 or wljs-graphics3d-threejs to write a polyfill or design a completely new feature to support backward compatibility.","date":"2023-07-21T00:00:00.000Z","formattedDate":"July 21, 2023","tags":[{"label":"frontend","permalink":"/wljs-docs/blog/tags/frontend"},{"label":"devnotes","permalink":"/wljs-docs/blog/tags/devnotes"}],"readingTime":0.82,"hasTruncateMarker":true,"authors":[{"name":"Kirill Vasin","title":"Maintainer","url":"https://github.com/JerryI","imageURL":"https://avatars.githubusercontent.com/u/4111822?s=48&v=4","key":"jerryi"}],"frontMatter":{"slug":"practical-working-withlibs","title":"Developing library function in a notebook","authors":"jerryi","tags":["frontend","devnotes"],"enableComments":true},"prevItem":{"title":"WLJS in practice. Integrating absorption spectra","permalink":"/wljs-docs/blog/practice-integration"},"nextItem":{"title":"Realtime path-tracing","permalink":"/wljs-docs/blog/rtx-intro"}},"content":"import Component from \'@site/src/components/wljs-notebook-react/includes\';\\nimport Notebook from \'@site/src/components/wljs-notebook-react\';\\n\\n<Component></Component>\\n\\nIn general, libraries shipped with WLJS Frontend are not reproducing even 20% of Mathematica\'s dynamic or graphics functions. Therefore, it is not a big deal to come back quite frequently to the source code of [wljs-graphics-d3](https://github.com/JerryI/wljs-graphics-d3) or [wljs-graphics3d-threejs](https://github.com/JerryI/Mathematica-ThreeJS-graphics-engine) to write a polyfill or design a completely new feature to support backward compatibility.  \\n\\nLuckily, since it is all running in a browser, we can take an advantage of using Javascript cells directly to build the missing functions. \\n\\n:::tip\\nThere is no need in rebuilding libraries or compiling the source code of the library or plugin (or refreshing the browser\'s window) to make a prototype of a feature. \\n\\nUse `.js` cells in the notebook for that.\\n:::\\n\\n\x3c!--truncate--\x3e\\n\\nHere we will have a look at `Polygon` in the context of 2D graphics. Here is my (@JerryI, maintainer) dev-notes on that\\n\\n\\n\\n<Notebook code=\\"\\" name=\\"recursion-35f74\\">recursion-35f74</Notebook>\\n\\nHere is the original notebook\\n- [Cinematographer.wl](Cinematographer.wl)\\n\\nThanks for reading! Hope it helps ;)"},{"id":"rtx-intro","metadata":{"permalink":"/wljs-docs/blog/rtx-intro","source":"@site/blog/2023-07-20-rtx/index.md","title":"Realtime path-tracing","description":"There is nothing more exciting in programming than designing a graphics application. Thankfully, there is one person on Github Garrett Johnson, who implemented a path-tracing algorithm on top of the well-known THREE.js graphics engine. Moreover, it fully supports features from the original library and can be anytime flipped as a main renderer.","date":"2023-07-20T00:00:00.000Z","formattedDate":"July 20, 2023","tags":[{"label":"frontend","permalink":"/wljs-docs/blog/tags/frontend"},{"label":"graphics","permalink":"/wljs-docs/blog/tags/graphics"}],"readingTime":0.56,"hasTruncateMarker":true,"authors":[{"name":"Kirill Vasin","title":"Maintainer","url":"https://github.com/JerryI","imageURL":"https://avatars.githubusercontent.com/u/4111822?s=48&v=4","key":"jerryi"}],"frontMatter":{"slug":"rtx-intro","title":"Realtime path-tracing","authors":"jerryi","tags":["frontend","graphics"],"enableComments":true},"prevItem":{"title":"Developing library function in a notebook","permalink":"/wljs-docs/blog/practical-working-withlibs"},"nextItem":{"title":"Hydrator experimantal feature","permalink":"/wljs-docs/blog/hydrator-xp"}},"content":"![](Screenshot%20from%202023-07-20%2020-04-08.png)\\n\\nThere is nothing more exciting in programming than designing a graphics application. Thankfully, there is one person on Github [Garrett Johnson](https://github.com/gkjohnson), who implemented a path-tracing algorithm on top of the well-known [THREE.js](https://threejs.org) graphics engine. Moreover, it fully supports features from the original library and can be anytime flipped as a main renderer.\\n\\n\x3c!--truncate--\x3e\\n\\nI hooked up his [library](https://github.com/gkjohnson/three-gpu-pathtracer) to works as a secondary engine for `Graphics3D` function presented in [wljs-graphics3d-threejs](https://github.com/JerryI/Mathematica-ThreeJS-graphics-engine) library. Just pass an option\\n\\n```mathematica\\nGraphics3D[%, \\"RTX\\"->True]\\n```\\n\\nAnd it will bake a realtime photorealistic image. It also supports all properties used in traditional rendering, i.e. `Emissive[]`, `Metallness[]`, HDRI map and many more!\\n\\nSome classical examples from Wolfram Mathematica\\n\\n![](IMG_0556.png)"},{"id":"hydrator-xp","metadata":{"permalink":"/wljs-docs/blog/hydrator-xp","source":"@site/blog/2023-07-15-hydrator.md","title":"Hydrator experimantal feature","description":"Here is an experimental feature provided by wljs-hydrator engine, that simply renders frontend object into a given div element","date":"2023-07-15T00:00:00.000Z","formattedDate":"July 15, 2023","tags":[{"label":"frontend","permalink":"/wljs-docs/blog/tags/frontend"},{"label":"html","permalink":"/wljs-docs/blog/tags/html"}],"readingTime":0.16,"hasTruncateMarker":true,"authors":[{"name":"Kirill Vasin","title":"Maintainer","url":"https://github.com/JerryI","imageURL":"https://avatars.githubusercontent.com/u/4111822?s=48&v=4","key":"jerryi"}],"frontMatter":{"slug":"hydrator-xp","title":"Hydrator experimantal feature","authors":"jerryi","tags":["frontend","html"],"enableComments":true},"prevItem":{"title":"Realtime path-tracing","permalink":"/wljs-docs/blog/rtx-intro"},"nextItem":{"title":"Interactive curves fitting example","permalink":"/wljs-docs/blog/curvesfit-example"}},"content":"import Component from \'@site/src/components/wljs-notebook-react/includes\';\\nimport Notebook from \'@site/src/components/wljs-notebook-react\';\\n\\n<Component></Component>\\n\\nHere is an experimental feature provided by [wljs-hydrator](https://github.com/JerryI/wljs-hydrator) engine, that simply renders frontend object into a given `div` element\\n\\n\x3c!--truncate--\x3e\\n\\n<Notebook code=\\"\\" name=\\"seasonably-220a6\\">seasonably-220a6</Notebook>"},{"id":"curvesfit-example","metadata":{"permalink":"/wljs-docs/blog/curvesfit-example","source":"@site/blog/2023-07-14-curves/index.md","title":"Interactive curves fitting example","description":"Here we will try to recreate a simple example of the interactive curves fitting based on Fit function provided by Wolfram Mathematica.","date":"2023-07-14T00:00:00.000Z","formattedDate":"July 14, 2023","tags":[{"label":"frontend","permalink":"/wljs-docs/blog/tags/frontend"},{"label":"dynamics","permalink":"/wljs-docs/blog/tags/dynamics"},{"label":"fitting","permalink":"/wljs-docs/blog/tags/fitting"}],"readingTime":1.3,"hasTruncateMarker":true,"authors":[{"name":"Kirill Vasin","title":"Maintainer","url":"https://github.com/JerryI","imageURL":"https://avatars.githubusercontent.com/u/4111822?s=48&v=4","key":"jerryi"}],"frontMatter":{"slug":"curvesfit-example","title":"Interactive curves fitting example","authors":"jerryi","tags":["frontend","dynamics","fitting"],"enableComments":true},"prevItem":{"title":"Hydrator experimantal feature","permalink":"/wljs-docs/blog/hydrator-xp"},"nextItem":{"title":"Interactive graphics example","permalink":"/wljs-docs/blog/balls-example"}},"content":"import Component from \'@site/src/components/wljs-notebook-react/includes\';\\nimport Notebook from \'@site/src/components/wljs-notebook-react\';\\n\\n<Component></Component>\\n\\n\\n![](ezgif.com-video-to-gif-18.gif)\\n\\n\\nHere we will try to recreate a simple example of the interactive curves fitting based on `Fit` function provided by Wolfram Mathematica.\\n\x3c!--truncate--\x3e\\n\\n## WLJS Frontend version\\n\\nFor the demonstration one can input the data points by clicking on an empty canvas\\n\\n```mathematica\\nRGBColor[1,1,1],\\n  EventHandler[Rectangle[{-10,10}, {10,-10}], {\\"click\\"->Function[xy, \\n    points = Append[points, xy]; \\n    fit = lineFit[points]\\n]}],\\n...\\n```\\n\\nAn event listener is attached to the rectangle at the background. Each time user clicks on it, it will append a new point to the array and recalculate fitter curve using defined `lineFit` function.\\n\\nTo draw our points and fitted curve, we need one line of a code\\n\\n```mathematica\\nPointSize[0.1],\\n  Red, Point[points//Hold], Cyan, Line[fit//Hold]\\n```\\n\\nThen, let us define the fitting function\\n\\n```mathematica\\nfit = {};\\npoints = {};\\norder = 1;\\n\\nlineFit[points_] := With[{o = Table[CM6Superscript[x, i], {i, 0, order}]},\\n  With[{f = Fit[points, o, x]}, \\n    Table[{x, f}, {x, -1,1, 0.025}]\\n  ]\\n]\\n```\\n\\nBasically,  it is done. However one can make it more interesting if we consider a control slider for changing the order of a curve as well as a clear button\\n\\n*in a new cell*\\n```mathematica\\nFunction[data, points = {}; fit = {};] // InputButton[\\"Clear\\"]\\nFunction[data, order = data; fit = lineFit[points]] // InputRange[1, 5, 1]\\n```\\n\\n:::info\\nA shortcut to assign a `handler` function to an event-object \\n```mathematica\\nhandler // EventObject[...]\\n```\\nis an equivalent of\\n```mathematica\\nEventHandler[EventObject[...], handler]\\n```\\n:::\\n\\nHere the full code\\n\\n<Notebook code=\\"\\" name=\\"hydraulics-3ae3e\\">hydraulics-3ae3e</Notebook>\\n\\nLinks\\n- [Download Notebook](CurvesFit.wl)\\n\\nThanks for reading! See you next time"},{"id":"balls-example","metadata":{"permalink":"/wljs-docs/blog/balls-example","source":"@site/blog/2023-07-13-balls/index.md","title":"Interactive graphics example","description":"Here we will try to recreate a simple example of the interactive plot, where bouncing dots are created using mouse clicks on an empty canvas.","date":"2023-07-13T00:00:00.000Z","formattedDate":"July 13, 2023","tags":[{"label":"frontend","permalink":"/wljs-docs/blog/tags/frontend"},{"label":"dynamics","permalink":"/wljs-docs/blog/tags/dynamics"}],"readingTime":2.255,"hasTruncateMarker":true,"authors":[{"name":"Kirill Vasin","title":"Maintainer","url":"https://github.com/JerryI","imageURL":"https://avatars.githubusercontent.com/u/4111822?s=48&v=4","key":"jerryi"}],"frontMatter":{"slug":"balls-example","title":"Interactive graphics example","authors":"jerryi","tags":["frontend","dynamics"],"enableComments":true},"prevItem":{"title":"Interactive curves fitting example","permalink":"/wljs-docs/blog/curvesfit-example"},"nextItem":{"title":"Introducing Events shortcuts","permalink":"/wljs-docs/blog/event-shortcuts"}},"content":"import Component from \'@site/src/components/wljs-notebook-react/includes\';\\nimport Notebook from \'@site/src/components/wljs-notebook-react\';\\n\\n<Component></Component>\\n\\n\\n![](ezgif.com-video-to-gif-16.gif)\\n\\n\\nHere we will try to recreate a simple example of the interactive plot, where bouncing dots are created using mouse clicks on an empty canvas.\\n\x3c!--truncate--\x3e\\n\\n## Mathematica\'s version\\n\\nOriginally it was designed for Wolfram Mathematica by Wolfram Research group. Let us have a look at the original core first\\n\\n```mathematica\\nFramed@DynamicModule[{points = {}, vel = {}}, \\n  EventHandler[\\n  \\n   Graphics[{PointSize[0.1], \\n\\t   Point[Dynamic[{vel, points} = animate[vel, points]; points]]}\\n\\t, PlotRange -> {{-1, 1}, {-1, 1}}], \\n   \\n   \\"MouseDown\\" :> ({points, vel} = \\n      addPoint[MousePosition[\\"Graphics\\"], points, vel])\\n  ]\\n]\\n```\\n\\nIt uses `DynamicModule` to localize dynamic variables and a set of two functions `animate` to recalculate new positions and `addPoint`.\\n\\n[Download Notebook](Balls.nb)\\n\\n## WLJS Frontend version\\n\\nTo recreate this using WLJS Frontend we need to change the way how dynamics is processed. Firstly, we need an event-listener object to get the place where a user clicked\\n\\n```mathematica\\nGraphics[{\\n\\tRGBColor[1,1,1],\\n\\tEventHandler[Rectangle[{-10,10},{10,-10}], {\\"click\\"->addPoint}],\\n\\tRGBColor[0,0,0], PointSize[0.1],\\n\\tPoint[points // Hold]\\n}]\\n```\\n\\nHere it creates a white rectangle in the background to add event-listener for clicks. And a global variable `points` is bounded to `Point` expression using `Hold`.\\n\\n:::danger\\n`EventHandler` expression does not fully correspond to the one used in Wolfram Mathematica\\n:::\\n\\n:::info\\nDynamic binding is possible only using global variables.\\n:::\\n\\nThen, we need an function, that adds dots to an array\\n\\n```mathematica\\npoints = {{0,0}};\\nvel = {RandomReal[{-1,1}]};\\n\\naddPoint[xy_] := (points = Append[points, xy]; vel = Append[vel, RandomReal[{-1,1},2]]);\\n```\\n\\nNow it should add new dots, when we click on a canvas\\n\\n![](ezgif.com-video-to-gif-17.gif)\\n\\n\\nOne thing is missing - animation. One need to update `points` symbol with a new positions and etc. The corresponding function will be\\n\\n```mathematica\\npoints = {{0,0}};\\nvel = {RandomReal[{-1,1}]};\\n\\naddPoint[xy_] := (points = Append[points, xy]; vel = Append[vel, RandomReal[{-1,1},2]]);\\n\\nanimate[i_] := points = MapIndexed[(If[Max[#1//Abs] > 1.2, vel[[#2//First]] = - vel[[#2//First]]]; #1 + 0.1 vel[[#2//First]])&, points];\\n```\\n\\nInstead of using timers, one can assign the an event handler to the transition animation, which is provided by [wljs-graphics-d3](https://github.com/JerryI/wljs-graphics-d3) library. \\n:::info\\nIO operations between the frontend and a server cannot run at full speed giving 60FPS, therefore the data is interpolated using the time-constant provided by the option to the `Graphics` expression called `\\"TransitionDuration\\"`.\\n:::\\n\\nTo capture the transitions we need a `MiddlewareHandler`\\n\\n```mathematica\\nPoint[MiddlewareHandler[points//Hold, \\"end\\"->animate, \\"Threshold\\"->0.2]]\\n```\\n\\nIt stands in between the drawing function and an updatable symbol. Threshold value specifies when the event `animate` will be fired, i.e. `1` means after the transition and anything less means, that it will be fired a bit early. It is used to compensate the latency of the network making the animation smoother. \\n\\nHere the full code\\n\\n<Notebook code=\\"\\" name=\\"expo-4312f\\">expo-4312f</Notebook>\\n\\nLinks\\n- [Download Notebook](Balls.wl)\\n\\nThanks for reading! See you next time"},{"id":"event-shortcuts","metadata":{"permalink":"/wljs-docs/blog/event-shortcuts","source":"@site/blog/2023-06-10-events.md","title":"Introducing Events shortcuts","description":"One of the paradigm of WLJS Frontend is an event-based approach. Any sliders, buttons are event generators, that produce EventObject[]. In order to simplify or mimic Mathematica\'s way of binding symbols to input elements Assign keyword was introduced.","date":"2023-06-10T00:00:00.000Z","formattedDate":"June 10, 2023","tags":[{"label":"frontend","permalink":"/wljs-docs/blog/tags/frontend"},{"label":"dynamics","permalink":"/wljs-docs/blog/tags/dynamics"},{"label":"events","permalink":"/wljs-docs/blog/tags/events"}],"readingTime":0.51,"hasTruncateMarker":true,"authors":[{"name":"Kirill Vasin","title":"Maintainer","url":"https://github.com/JerryI","imageURL":"https://avatars.githubusercontent.com/u/4111822?s=48&v=4","key":"jerryi"}],"frontMatter":{"slug":"event-shortcuts","title":"Introducing Events shortcuts","authors":"jerryi","tags":["frontend","dynamics","events"],"enableComments":true},"prevItem":{"title":"Interactive graphics example","permalink":"/wljs-docs/blog/balls-example"},"nextItem":{"title":"Introducing middleware event handlers","permalink":"/wljs-docs/blog/middleware-example"}},"content":"One of the paradigm of WLJS Frontend is an event-based approach. Any sliders, buttons are event generators, that produce `EventObject[<|...|>]`. In order to simplify or mimic Mathematica\'s way of binding symbols to input elements `Assign` keyword was introduced.\\n\\nInstead of \\n\\n```mathematica\\nInputRange[0,1, 0.1]\\nEventHandler[%, Function[data, x = data]]\\n```\\n\\none can write\\n\\n```mathematica\\nInputRange[0,1, 0.1] // Assign[x]\\n```\\n\\nThe result will be the same\\n\x3c!--truncate--\x3e\\nGoing further, one should note, that \\n\\n:::info\\n`EventHandler` or `Assign` returns the same object `EventObject[<||>]` as it has on input. On cell\'s output `EventObject[<|\\"view\\"->...|>]` a field `view` will be displayed by automatic converting it into `FrontEndExecutable`.\\n:::"},{"id":"middleware-example","metadata":{"permalink":"/wljs-docs/blog/middleware-example","source":"@site/blog/2023-05-11-middleware/index.md","title":"Introducing middleware event handlers","description":"To describe the idea of a new tool better, it is good to start from the initial problem.","date":"2023-05-11T00:00:00.000Z","formattedDate":"May 11, 2023","tags":[{"label":"frontend","permalink":"/wljs-docs/blog/tags/frontend"},{"label":"dynamics","permalink":"/wljs-docs/blog/tags/dynamics"}],"readingTime":3.77,"hasTruncateMarker":true,"authors":[{"name":"Kirill Vasin","title":"Maintainer","url":"https://github.com/JerryI","imageURL":"https://avatars.githubusercontent.com/u/4111822?s=48&v=4","key":"jerryi"}],"frontMatter":{"slug":"middleware-example","title":"Introducing middleware event handlers","authors":"jerryi","tags":["frontend","dynamics"],"enableComments":true},"prevItem":{"title":"Introducing Events shortcuts","permalink":"/wljs-docs/blog/event-shortcuts"},"nextItem":{"title":"Introducing metamarkers","permalink":"/wljs-docs/blog/meta-example"}},"content":"![](ezgif.com-video-to-gif-25.gif)\\n\\n\\nTo describe the idea of a new tool better, it is good to start from the initial problem. \\n\\nimport Component from \'@site/src/components/wljs-notebook-react/includes\';\\nimport Notebook from \'@site/src/components/wljs-notebook-react\';\\n\\n<Component></Component>\\n\\nThe data transfer via `ExpressionJSON` representation over the WebSocket protocol adds a significant latency. What if we want to implement __real-time visualization with a least  $\\\\sim 30FPS$ ?__\\n\\n\x3c!--truncate--\x3e\\n\\n## Interpolation\\nA standard library [wljs-graphics-d3](https://github.com/JerryI/wljs-graphics-d3) based on D3.js provides a decent transition mechanism, that makes a nice animated transitions from the old dataset to a new one perfectly in-sync with browser\'s refresh rate.\\n\\nLet us have a look at the example __with no interpolation involved__\\n\\n```mathematica\\np = {-1,0};\\nGraphics[{PointSize[0.1], Point[{p} // Hold]}, \\"TransitionDuration\\"->0.1]\\n```\\n\\nBy updating the position \\n\\n```mathematica\\nDo[\\n  p = {x, Cos[10 x]}; \\n  \\n  (* simulate load *)\\n  Pause[0.2];\\n, {x,-1,1,0.1}]\\n```\\n\\nwe will see the following\\n\\n![](ezgif.com-video-to-gif-19.gif)\\n\\nTo __enable the interpolation__ specify `TransitionDuration`\\n\\n```mathematica\\nGraphics[{Cyan, PointSize[0.1],Point[{p} // Hold]}, ImageSize->{600,100}, \\"TransitionDuration\\"->300, \\"TransitionType\\"->\\"Linear\\"]\\n```\\n\\nNow the transition time overlaps with our `Pause[0.2]` time period, that results in a kinda smooth behaviour. \\n\\n![](ezgif.com-video-to-gif-20.gif)\\n\\nThis approach might work well in a case, __when there is only one object to animate__.\\n\\n## Event-based approach\\n\\nHaving a fixed time delay and a loop in general __is a waste of resources__, especially when it comes to many independent animations. \\n\\nOne can assign all animations to the framerate of the browser, however doing that in a one directional way will introduce some issues, if the calculation time temporary exceeds the given time-window for render.\\n\\nSince we anyway are using [Interpolation](#Interpolation), one can use its local time-scale to call the next animation frame to be calculated (or data points will be updated).\\n\\nAssuming *$t_{calc} \\\\approx t_{transition}$ then we introduce a threshold value (0-1) that specifies, when the event of recalculating the position fires with respect to the duration of transition animation\\n\\n*threshold = 0.9*\\n![](ezgif.com-video-to-gif-22.gif)\\n*threshold = 0.5*\\n![](ezgif.com-video-to-gif-23.gif)\\n*threshold = 0.1*\\n![](ezgif.com-video-to-gif-24.gif)\\n\\nThe good thing about it is that \\n:::info\\nA new transition will not occur if the calculation has not finished. \\n:::\\n\\nA threshold and transition duration values can be adjusted to get the maximum smoothness and performance based on the network conditions and CPU load.\\n\\n### Implementation\\nOne need to have an access to the transition process happening at the particular graphics element? Why not just\\n\\n```mathematica\\nEventHandler[Point[p // Hold], \\"transition\\"->calc] ???\\n```\\n\\nHere is why.\\n\\nFor the perspective of Javascript D3.js library used in frontend, when one calls\\n\\n*regular evaluation*\\n```mathematica\\nPoint[p // Hold]\\n```\\n```javascript\\n> d3.Selection<SVGElement, unknown, HTMLElement, any>\\n```\\n\\n*update method*\\n```mathematica\\nPoint[p // Hold]\\n```\\n```javascript\\n> d3.Transition<GElement extends BaseType, Datum, PElement extends BaseType, PDatum>\\n```\\n\\nHere one could attach to the returned object via\\n\\n```javascript\\n(object) => {\\n\\tlet state = false;\\n\\tobject.tween(uid, function (d) {\\n\\t\\treturn function (t) {\\n\\t\\t\\tif (t >= threshold && !state) {\\n\\t\\t\\t\\tserver.emitt(uid, `True`);\\n\\t\\t\\t\\tstate = true;\\n\\t\\t\\t}\\n\\t\\t}\\n\\t}))\\n}\\n```\\n\\nYou have to attach it every-time when a transition occur, since each time this is a new object.\\n\\nHowever, there is a problem\\n\\n:::info\\nDynamic binding happens only between containers (virtual or real), i.e. `p` and `Point` expressions\\n\\n```mathematica\\nOurHandler[Point[p // Hold]] // Graphics\\n```\\n\\nThe upper expression `Point` scopes all variables. When `p` updates, `OurHandler` or `Graphics` expression __will not be evaluated__!\\n:::\\n\\nIt means, that in general `EventHandler` method, where the event-binding is executed from outside to inside works well for the static evaluation, but events generated during dynamic updates will not be captured!\\n\\n__We need to bind from inside__\\n\\n```mathematica\\nPoint[MiddlewareHandler[p // Hold, \\"end\\"->calc]] // Graphics\\n```\\n\\nNow the whole expression `Point` including all its guts will be evaluated during the dynamic updates of any inner expressions.\\n\\nWith some tweaked added to the WLJS Interpreter, I (@JerryI) managed to make it work properly as intended. \\n\\n### How to use\\nThere is only one event type has been implemented by now.\\n\\n```mathematica\\nPoint[MiddlewareHandler[data // Hold, \\"end\\"->calc, \\"Threshold\\"->0.5]] // Graphics\\n```\\n\\nor\\n\\n```mathematica\\nLine[MiddlewareHandler[data // Hold, \\"end\\"->calc, \\"Threshold\\"->0.5]]\\n```\\n\\nor even for the transformations\\n\\n```mathematica\\nTranslate[MiddlewareHandler[Point[{0,0}], \\"end\\"->calc], data // Hold]\\n```\\n\\nwhere\\n\\n```mathematica\\ncalc[garbage_] := data = recalculate[data];\\n```\\n\\n:::tip\\nPlace `MiddlewareHandler` inside any expression, of which you want to track the transition process. It acts as `Identity` operator, i.e. allows safely wrapping around any other expression. \\n:::\\n\\n:::info\\n`MiddlewareHandler` fires the first (zero) event just when it has been created\\n:::\\n\\n## Making 2D Game\\nNow we can use this trick for any projectiles in game animations! Each created object will be handled by its own `MiddlewareHandler`\\n\\n<Notebook code=\\"\\" name=\\"quinsy-b6236\\">quinsy-b6236</Notebook>\\n\\nDownload notebook\\n- [Baster.wl](Baster.wl)"},{"id":"meta-example","metadata":{"permalink":"/wljs-docs/blog/meta-example","source":"@site/blog/2023-04-20-placed/index.md","title":"Introducing metamarkers","description":".png)","date":"2023-04-20T00:00:00.000Z","formattedDate":"April 20, 2023","tags":[{"label":"evaluation","permalink":"/wljs-docs/blog/tags/evaluation"},{"label":"metamarkers","permalink":"/wljs-docs/blog/tags/metamarkers"}],"readingTime":1.665,"hasTruncateMarker":true,"authors":[{"name":"Kirill Vasin","title":"Maintainer","url":"https://github.com/JerryI","imageURL":"https://avatars.githubusercontent.com/u/4111822?s=48&v=4","key":"jerryi"}],"frontMatter":{"slug":"meta-example","title":"Introducing metamarkers","authors":"jerryi","tags":["evaluation","metamarkers"],"enableComments":true},"prevItem":{"title":"Introducing middleware event handlers","permalink":"/wljs-docs/blog/middleware-example"}},"content":"![](screenshot(5).png)\\n\\n\\nTo add new elements to a plot / graph there is no need in full reevaluation of a cell or using dynamic binding. Since the context of executing is stored together with an object, one can simply evaluate (in-place) the needed expression.\\n\x3c!--truncate--\x3e\\n\\nimport Component from \'@site/src/components/wljs-notebook-react/includes\';\\nimport Notebook from \'@site/src/components/wljs-notebook-react\';\\n\\n<Component></Component>\\n\\nLet\'s have a look at the following example\\n\\n```mathematica\\nPlot[Sin[x], {x,0,Pi}, Epilog->{MetaMarker[\\"myplot\\"]}]\\n```\\n\\nHere it results in `Graphics` expressions with a bunch of `Line` lying inside, while `Epilog` option just puts the given expression into the end of the same `Graphics` object.\\n\\n![](Screenshot%202023-07-14%20at%2015.36.32.png)\\n\\nYou can think about `MetaMarker` as if it was `<div id=\\"\\">` or class, that allows you to identify that particular object in the given context.\\n\\nAfter than one can simply execute an expression by using the following expression\\n\\n```mathematica\\nPlaced[{\\n\\tRGBColor[1,0,1], \\n\\tLine[{{0,0},{0.4,1}}]\\n}, FindMetaMarker[\\"myplot\\"]//First] // Hold // FrontSubmit\\n```\\n\\nAs a result, the graph will show a new feature\\n\\n![](Screenshot%202023-07-14%20at%2015.37.00.png)\\n\\nThis does not depend on `Graphics` object, it can be anything in principle.\\n\\n## Voxel cellular automaton\\nFor example, let us create an empty 3D canvas\\n\\n```mathematica\\nGraphics3D[{Sky[], MetaMarker[\\"marker\\"]},  \\"Lighting\\"->None]\\n```\\n\\nThen using build-in cellular automaton, we can visualize it lively in 3D using simple `Cuboid` shapes with different colors\\n\\n```mathematica\\nsize = {10,10};\\nboard = CellularAutomaton[{6, {2, 1}, {1, 1}}, {{{1}}, 0}, 50]//First;\\nsize = board//Dimensions\\n\\nz = 20;\\n\\niterate := (\\n board = CellularAutomaton[{6, {2, 1}, {1, 1}}, board];\\n\\n Table[\\n  If[board[[i+size[[1]]/2 // Floor,j+size[[2]]/2 // Floor]] > 0, \\n    With[{coords = Cuboid[{i+1,j+1,z+0.8}, {i,j,z}], color = {1+i/100,1+i/100,(z+10)/10}},\\n    \\n      Placed[{ RGBColor@color, coords}, FindMetaMarker[\\"marker\\"]//First] // Hold // FrontSubmit;\\n      Pause[0.02];\\n      \\n    ]\\n  ];\\n , {i, -size[[1]]/2//Floor, size[[1]]/2//Floor}, {j, -size[[2]]/2//Floor, size[[2]]/2//Floor}];\\n z = z - 0.8;\\n);\\n```\\n\\nIf a cell is 1, then it will be a cube on that place. By calling\\n\\n```mathematica\\nDo[iterate //Quiet;, {i,1,10}];\\n```\\n\\nOne can observe in real time the following\\n\\n![](ezgif.com-optimize-10.gif)\\n\\nThe full code is presented below\\n\\n<Notebook code=\\"\\" name=\\"speakeasy-b5f04\\">speakeasy-b5f04</Notebook>\\n\\nYou can also download this notebook via a link\\n- [VoxelAutomata.wl](VoxelAutomata.wl)\\n\\nThank you for reading! See you"}]}')}}]);